import { connect } from "react-redux";
function Accounts(props) {
  return (
    <div className="card">
      {props.accounts.map((acc) => (
        <li key={acc.id}>
          {acc.name} - {acc.email}
        </li>
      ))}
    </div>
  );
}
const mapStateToProps = (state) => {
  return {
    accounts: state.accounts,
  };
};

export default connect(mapStateToProps, {})(Accounts);
